definition.precondition:
- SprayGun deve pertencer a a mesma linha aonde o veículo se econtra;
- SprayGun deve estar com a cor que o carro precisa ser pintado;
- O limite de pintura sucessivas com a mesma cor não deve ter sido atingido;
- O veículo é realmente o próximo a ser pintado;
- O véiculo não pode ter siso pintado antes e nem montado.
